(*q-series for theta functions are used below to take correctly the q->0 limit:*)
qSeriesTheta[order_]:={
EllipticTheta[1, z_, q_]:>2 q^(1/4) Sum[(-1)^k q^(k (k + 1)) Sin[(2 k + 1) z], {k, 0, order}]
}
qSeriesThetaPrime[order_]:={
EllipticThetaPrime[1, z_, q_]:>2 q^(1/4) Sum[(-1)^k q^(k (k + 1)) (2 k + 1) Cos[(2 k + 1) z], {k, 0, order}]
}
qSeriesThetaPrimeDER[order_]:={
Derivative[0, 1, 0][EllipticThetaPrime][1, z_, q_]:>2 q^(1/4) Sum[-(-1)^k (1+2 k)^2 q^(k (1+k)) Sin[(1+2 k) z], {k, 0, order}],
Derivative[0, 2, 0][EllipticThetaPrime][1, z_, q_]:>2 q^(1/4) Sum[-(-1)^k (1+2 k)^3 q^(k (1+k)) Cos[(1+2 k) z], {k, 0, order}],
Derivative[0, 3, 0][EllipticThetaPrime][1, z_, q_]:>2 q^(1/4) Sum[(-1)^k (1+2 k)^4 q^(k (1+k)) Sin[(1+2 k) z], {k, 0, order}]
}


