temp5=temp4//factorNum[#]//.a_?NumericQ int[b_,int[c_,int[e_]]]:>int[b,int[a*c,int[e]]]//.int[b_,int[c_ d[z_],int[e_]]]+int[b_,int[ct_ d[z_],int[e_]]]:>int[b,int[(c+ct)d[z],int[e]]]//.int[b_,int[c_,int[e_]]]:>int[b,int[FullSimplify@Factor@TrigToExp@c,int[e]]]&;Null;
